import { Component } from 'react';
import './Gallery.css'
import PropTypes from "prop-types";

class Gallery extends Component {
    constructor(props) {
        super(props);
        this.handlePositionChange = this.handlePositionChange.bind(this);
    }
    static propTypes = {
        onPositionChange: PropTypes.func,
    };

    static defaultProps = {
        onPositionChange: () => { }
    }

    handlePositionChange(event) {
        console.log(event.target.id);
        const onPositionChange = this.props.onPositionChange;
        onPositionChange(event);
    }

    render() {
        return (
            <div class="Gallery" id = "GalleryID">
                <button class = "Position" id = "All" onClick={this.handlePositionChange}>All</button>
                <button class = "Position" id = "PG"onClick={this.handlePositionChange}>PG</button>
                <button class = "Position" id = "PG"onClick={this.handlePositionChange}>SG</button>
                <button class = "Position" onClick={this.handlePositionChange}>G</button>
                <button class = "Position" onClick={this.handlePositionChange}>SF</button>
                <button class = "Position" onClick={this.handlePositionChange}>PF</button>
                <button class = "Position" onClick={this.handlePositionChange}>F</button>
                <button class = "Position" onClick={this.handlePositionChange}>C</button>
            </div>
        );
    }
}

export default Gallery;
